-- Table structure for report_template
DROP TABLE IF EXISTS report_template CASCADE;
CREATE TABLE report_template (
    id integer NOT NULL DEFAULT nextval('report_template_id_seq'::regclass),
    name character varying(255) NOT NULL,
    type character varying(50) NOT NULL,
    sections text NOT NULL,
    sorting text NULL,
    filters text NULL,
    description text NULL,
    created_at timestamp without time zone NULL,
    updated_at timestamp without time zone NULL,
    created_by integer NULL,
    is_public boolean NULL,
    PRIMARY KEY (id)
);

-- Table structure for scheduled_report
DROP TABLE IF EXISTS scheduled_report CASCADE;
CREATE TABLE scheduled_report (
    id integer NOT NULL DEFAULT nextval('scheduled_report_id_seq'::regclass),
    template_id integer NOT NULL,
    format character varying(50) NOT NULL,
    frequency character varying(50) NOT NULL,
    day character varying(50) NULL,
    time character varying(50) NULL,
    recipients text NULL,
    subject character varying(255) NULL,
    is_active boolean NULL,
    created_at timestamp without time zone NULL,
    updated_at timestamp without time zone NULL,
    created_by integer NULL,
    last_run timestamp without time zone NULL,
    next_run timestamp without time zone NULL,
    PRIMARY KEY (id)
);

-- Table structure for system_setting
DROP TABLE IF EXISTS system_setting CASCADE;
CREATE TABLE system_setting (
    id integer NOT NULL DEFAULT nextval('system_setting_id_seq'::regclass),
    key character varying(128) NOT NULL,
    value text NULL,
    value_type character varying(32) NULL,
    description text NULL,
    updated_at timestamp without time zone NULL,
    updated_by_id integer NULL,
    PRIMARY KEY (id)
);

-- Table structure for tax_code
DROP TABLE IF EXISTS tax_code CASCADE;
CREATE TABLE tax_code (
    id integer NOT NULL DEFAULT nextval('tax_code_id_seq'::regclass),
    code character varying(20) NOT NULL,
    levy_amount double precision NULL,
    levy_rate double precision NULL,
    previous_year_rate double precision NULL,
    total_assessed_value double precision NULL,
    created_at timestamp without time zone NULL,
    updated_at timestamp without time zone NULL,
    description character varying(255) NULL,
    year integer NULL DEFAULT EXTRACT(year FROM CURRENT_DATE),
    PRIMARY KEY (id)
);

