-- Table structure for tax_code_historical_rate
DROP TABLE IF EXISTS tax_code_historical_rate CASCADE;
CREATE TABLE tax_code_historical_rate (
    id integer NOT NULL DEFAULT nextval('tax_code_historical_rate_id_seq'::regclass),
    tax_code_id integer NOT NULL,
    year integer NOT NULL,
    levy_rate double precision NOT NULL,
    levy_amount double precision NULL,
    total_assessed_value double precision NULL,
    created_at timestamp without time zone NULL,
    updated_at timestamp without time zone NULL,
    PRIMARY KEY (id)
);

-- Table structure for tax_district
DROP TABLE IF EXISTS tax_district CASCADE;
CREATE TABLE tax_district (
    id integer NOT NULL DEFAULT nextval('tax_district_temp_id_seq'::regclass),
    year integer NOT NULL,
    district_name character varying(128) NOT NULL,
    district_code character varying(16) NOT NULL,
    district_type character varying(64) NULL,
    county character varying(64) NULL,
    state character varying(2) NULL,
    description text NULL,
    is_active boolean NULL,
    contact_name character varying(128) NULL,
    contact_email character varying(128) NULL,
    contact_phone character varying(20) NULL,
    statutory_limit double precision NULL,
    created_at timestamp without time zone NOT NULL,
    updated_at timestamp without time zone NOT NULL,
    created_by_id integer NULL,
    updated_by_id integer NULL,
    PRIMARY KEY (id)
);

