-- Table structure for tax_district_old
DROP TABLE IF EXISTS tax_district_old CASCADE;
CREATE TABLE tax_district_old (
    id integer NOT NULL DEFAULT nextval('tax_district_id_seq'::regclass),
    year integer NOT NULL,
    levy_code character varying(20) NOT NULL,
    linked_levy_code character varying(20) NOT NULL,
    created_at timestamp without time zone NULL,
    updated_at timestamp without time zone NULL,
    district_name character varying(255) NOT NULL DEFAULT 'Unknown District'::character varying,
    statutory_limit double precision NULL,
    tax_district_id character varying(20) NOT NULL,
    PRIMARY KEY (id)
);

